姐罗丝的哭声。艾瑞丝到文胸店去上班，面对老板的挑剔，艾瑞丝这次没有再忍耐，她凶狠的骂了老板一句，愤然的离开了她上班的地方。艾瑞丝到电影院看电影，宽敞的影院里，稀疏的坐着几个人，艾瑞丝就在这稀疏的几个人中，认识了男孩汤姆。艾瑞丝和汤姆还没有等电影结束，就迫不及待的在电影院外，激情的拥吻在一起，当晚，汤姆留在了艾瑞丝新租住的家里。艾瑞丝在床上手淫，姐姐打来电话，说她想念母亲。艾瑞丝听了姐姐电话，呆了一会，然后，她把母亲留下的皮衣和假发，穿在了自己身上。原本清纯的艾瑞丝把自己打扮的像一个妓女一样，来到了教堂，听着教堂里的老人们唱着圣歌，艾瑞丝仿佛想起了什么。穿着母亲衣服戴着母亲假发的艾瑞丝和女友到酒吧，放荡的勾引男人，并带回家里，肆意的寻欢作乐。在每一次快感之后，艾瑞丝都仔细的回想性给她带来的快乐感觉。艾瑞丝想要加入教堂的圣歌班，但她在试唱时，不管怎么努力，声音都老是跑调。艾瑞丝气恼的走出教堂，遇到了前来找她的男友，面对男友指责她的放荡行为，艾瑞丝却故意的挑逗男友，要在车里跟他作爱。被男友拒绝后的艾瑞丝找到汤姆，汤姆和艾瑞丝亲热完后，不耐烦理她，匆匆离去。罗丝找到艾瑞丝询问母亲骨灰盒的去向，心情不好的艾瑞丝没好气的告诉姐姐骨灰盒丢了，并还哭闹着把姐姐赶出了家门。艾瑞丝等候在电话旁，希望汤姆能跟她约会。等到天黑，汤姆也没有来电话，艾瑞丝慢慢走回家里。艾瑞丝一进家门，就看到以前在街上遇到的一个性伙伴正在家里等她。对方要求跟艾瑞丝玩一个性游戏时，蒙上了她的眼睛，在让艾瑞丝摆好姿势后，对方却突然向她身上小便。艾瑞丝逃到卫生间，匆忙的洗了个澡，从窗户里逃到了街上。艾瑞丝走在街上，几个小女孩抢走了她的手提包。艾瑞丝去找姐姐借钱，又发现母亲的戒指在姐姐手上，而姐姐以前告诉她母亲的戒指没有找到，这让恼火的艾瑞丝在车站追着去上班的姐姐一阵打骂。伤心的艾瑞丝来到男友家里，却看到她最好的女友在男友家里。艾瑞丝回到姐姐家里，家里只有姐夫在家，艾瑞丝又想要勾引姐夫，但姐夫面对满屋即将快要出生的孩子的玩具，理智的拒绝了她。姐姐到艾瑞丝的家里，解释戒指的事，听了姐姐的话，艾瑞丝把母亲的骨灰拿了出来，随后，扑在姐姐怀里，痛哭了起来。在姐姐的带领下，艾瑞丝在台上，重新开始唱歌。艾瑞丝抱着罗丝生的小孩，看着她把母亲的骨灰埋在花下。艾瑞丝仍然想念母亲，但没有以前强烈了，偶尔走在街上的时候，看见长得像母亲的人，她依然能想起母亲。";s:13:"vod_play_from";s:9:"zuidam3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:55:"BD$https://eth.ppzuida.com/20171115/kXRGW100/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:20;s:9:"type_name";s:6:"福利";s:7:"type_en";s:4:"fuli";s:9:"type_sort";i:5;s:8:"type_mid";i:1;s:8:"type_pid";i:0;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:0:"";s:8:"type_des";s:0:"";s:10:"type_title";s:0:"";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:0:"";s:4:"area";s:0:"";s:4:"lang";s:0:"";s:4:"year";s:0:"";s:4:"star";s:0:"";s:8:"director";s:0:"";s:5:"state";s:0:"";s:7:"version";s:0:"";}s:8:"childids";N;}s:6:"type_1";N;}i:40;a:80:{s:6:"vod_id";i:49124;s:7:"ty